query BlogsByTags($id: ID) {
  posts: allPost (filter: {tags: {contains: [$id]}}) {
    edges {
      node {
        title
        path
        excerpt
        author {
          id
          title
          image
          path
          email
        }
        tags {
          id
          path
        }
      }
    }
  }
}
